105 minuten

een goeie film

met 50 Cent, Samuel L. Jackson en Jessica Biel

Een oorlogsdokter keert terug naar huis na enkele maanden aan het Iraakse front te hebben gezeten. Maar zijn familie, vrienden en 
vooral zijn vrouw, herkennen hem niet meer. Met hem keren veel soldaten terug van de strijd, ieder met zo zijn eigen problemen om 
weer terug te keren in de 'normale' maatschappij.:
